import React from "react";
import web from "../src/images/headerimg.svg";
import { NavLink } from "react-router-dom/cjs/react-router-dom.min";
import Common from "./Common";

const Home = () => {
  return (
    <>
      <Common 
      name ="Grow Your Business with" 
      imgsrc={web} 
      visit="/contact" 
      btname ="Get Started" 
      />
      </>
  );
};
export default Home;
